import React from "react";
import { Nav } from "react-bootstrap";

function Sidebar({ collapsed, setPage }) {
  return (
    <Nav defaultActiveKey="/home" className="flex-column p-3">
      <Nav.Link
        href="#"
        active
        onClick={() => setPage("profile")}
      >
        {collapsed ? "P" : "Profile"}
      </Nav.Link>
      <Nav.Link
        href="#"
        onClick={() => setPage("articles")}
      >
        {collapsed ? "A" : "My Articles"}
      </Nav.Link>
      <Nav.Link href="#">{collapsed ? "S" : "Settings"}</Nav.Link>
    </Nav>
  );
}

export default Sidebar;
